import React from 'react'
import { FaShoppingCart } from "react-icons/fa";

export const Navbar = () => {
  return (
    <div className='bg-blue-500'>
        <div className='flex flex-row justify-between'>
           <div>
           <img className='h-20px' src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fstock.adobe.com%2Fsearch%3Fk%3Dcode%2Blogo&psig=AOvVaw0plY95dc2QowfYT3dZyF4s&ust=1680541358508000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCNDHr8fWi_4CFQAAAAAdAAAAABAE"/>
           </div>
           <div>
               <p>Home</p>
               <div>
                   <FaShoppingCart />
               </div>
           </div>
            
        </div>
    </div>
  );
}
export default Navbar;
